// src/components/FooterNav.jsx
import React from "react";
import styled from "styled-components";

const Footer = styled.div`
  position: fixed;
  bottom: 2rem;
  width: 100%;
  display: flex;
  justify-content: center;
  gap: 2rem;
  z-index: 100;
`;

const Item = styled.div`
  background: white;
  color: black;
  border-radius: 999px;
  padding: 0.5rem 1.2rem;
  font-weight: bold;
  cursor: pointer;
  font-size: 0.9rem;
`;

const FooterNav = () => {
  return (
    <Footer>
      <Item>Work</Item>
      <Item>About</Item>
      <Item>Careers</Item>
    </Footer>
  );
};

export default FooterNav;
